import NavBar from "./NavBar";


function CustomBar({customCities}){
    

    return(
        <Fragment>
            { customCities && customCities.map((_,index)=>(
                
                <button key={`city${index}`}>{cities[index]}</button>
            ))}
        </Fragment>
    );

}

export default CustomBar;
